import React from "react";
import { View, Text, TouchableOpacity } from "react-native";

export default function({navigation, route}) {
    const {Nome, Descrição, Imagem} = route.params;
    return (
        <View>
            <TouchableOpacity>
                <Text>{Nome}</Text>
                <Text>{Imagem}</Text>
                <Text>{Descrição}</Text>
            </TouchableOpacity>
        </View>
    )

}
